        <Route path="profile" element={<Profile />} />
        {localStorage.getItem("key") == 1 ? (
          <Route path="admin" element={<Page1 />} />
        ) : localStorage.getItem("key") == 3 ? (
          <Route path="manager" element={<Manager />} />
